--- !ruby/object:ProtocolDataset::DataSet 
#===============================================================================
# Data set description
#===============================================================================

description: !ruby/object:ProtocolDataset::DataSetDescription 
  name: NCIA_HB375x10
  references:
    "10.1021/acs.jctc.9b01265": "J. Rezac, J. Chem. Theory Comput. 2020, 16, 4, 2355-2368"
  text: "CCSD(T)/CBS interaction energies of H-bonds and decoys, 10-point dissociation curves"
  method_geometry: B3LYP-D3(BJ)/def2-QZVP minimum + scaling of closest contact distance along interaction coordinate
  method_energy: |
    First point and equlibrium geometry - composite CCSD(T)/CBS, CP-corrected, Helgaker extrapolation, frozen core:
    HF/aug-cc-pV5Z
    dMP2/aug-cc-pVQZ -> aug-cc-pV5Z
    dCCSD(T)/heavy-aug-cc-PVTZ
    Other points: same scheme with HF/aug-cc-pVQZ + dMP2/aug-cc-pVTZ -> aug-cc-pVQZ + dCCSD(T)/aug-cc-PVDZ,
    rescaled to the higher level

  units: kcal/mol

  groups_by: by the type of the interaction
  groups:
    - OH-O
    - NH-O
    - OH-N
    - NH-N
    - CH-N
    - CH-O
    - noHB
  
  global_setup:
    job: interaction
    molecule_a:
      selection: "auto"
      charge: 0
      multiplicity: 1
    molecule_b:
      selection: "auto"
      charge: 0
      multiplicity: 1

